import React, { Component } from 'react'
 class Projectdetails extends Component{
     constructor(props){
         super(props);
     }
     async componentDidMount(){
         console.log('from projdetails' , this.props.address)
     }
     render(){
         return(
             <h1>ok</h1>
         );
     }
 }
 export default Projectdetails;
